import {Component, OnInit} from '@angular/core';
import {Item} from './item/item.model';
import {SearchService} from '../../services/search.service';
import {DomSanitizer} from '@angular/platform-browser';

@Component({
  selector: 'app-itemlist',
  templateUrl: './itemlist.component.html',
  styleUrls: ['./itemlist.component.css']
})
export class ItemlistComponent implements OnInit {

  searchinput = '';
  displayeditems;

  safeImgPath = this._sanitizer.bypassSecurityTrustResourceUrl('data:image/png;base64,' + '');

  shopitems: Item[] = [
    new Item('Electric 1', 'newest Electric 1', 399, this.safeImgPath)
  ];


  constructor(private searchService: SearchService, private _sanitizer: DomSanitizer) {
  }

  ngOnInit() {
    this.displayeditems = this.shopitems;
    this.searchService.activeSearch.subscribe((searchInput: string) => {
      this.searchinput = searchInput;
      this.updateItems();
    });
  }

  public updateItems() {
    if (this.searchinput !== '') {
      this.displayeditems = this.shopitems.filter(product => product.name.toLowerCase().includes(this.searchinput.toLowerCase()));
    } else {
      this.displayeditems = this.shopitems;
    }
  }
}
